import React from 'react';
import './index.css'

const arc=()=> {
        return (
            <div>
                <div id='insideCir'>
                  <div id='insideSmallCir'></div>
                  <div id='insideSmallCirTow'></div>
                  <div id='insideSmallCirThree'></div>
                </div>
                <div id='outsideCir'>
                <div id='outsidesSmallCir'></div>
                <div id='outsidesSmallCirTow'></div>
                <div id='outsidesSmallCirThree'></div>
                </div>
            </div> 
        )
}

export default arc;
